package csdl;

import java.util.Date;

/**
 *
 * @author Administrator
 */
public class ReportPhieuCapLuong {
    Long maTinhluong;
    Long maNV;
    Float luongCB;
    int soNLV;
    Float thuong;
    Float phuCap;
    Float tru;
    Float thue;
    Float tongLuong;
    Date ngayPhat;
    String tenNV;
    String tenPTC;

    public String getTenNV() {
        return tenNV;
    }

    public void setTenNV(String tenNV) {
        this.tenNV = tenNV;
    }

    public String getTenPTC() {
        return tenPTC;
    }

    public void setTenPTC(String tenPTC) {
        this.tenPTC = tenPTC;
    }

    public Long getMaTinhluong() {
        return maTinhluong;
    }

    public void setMaTinhluong(Long maTinhluong) {
        this.maTinhluong = maTinhluong;
    }

    public Long getMaNV() {
        return maNV;
    }

    public void setMaNV(Long maNV) {
        this.maNV = maNV;
    }

    public Float getLuongCB() {
        return luongCB;
    }

    public void setLuongCB(Float luongCB) {
        this.luongCB = luongCB;
    }

    public int getSoNLV() {
        return soNLV;
    }

    public void setSoNLV(int soNLV) {
        this.soNLV = soNLV;
    }

    public Float getThuong() {
        return thuong;
    }

    public void setThuong(Float thuong) {
        this.thuong = thuong;
    }

    public Float getPhuCap() {
        return phuCap;
    }

    public void setPhuCap(Float phuCap) {
        this.phuCap = phuCap;
    }

    public Float getTru() {
        return tru;
    }

    public void setTru(Float tru) {
        this.tru = tru;
    }

    public Float getThue() {
        return thue;
    }

    public void setThue(Float thue) {
        this.thue = thue;
    }

    public Float getTongLuong() {
        return tongLuong;
    }

    public void setTongLuong(Float tongLuong) {
        this.tongLuong = tongLuong;
    }

    public Date getNgayPhat() {
        return ngayPhat;
    }

    public void setNgayPhat(Date ngayPhat) {
        this.ngayPhat = ngayPhat;
    }
}
